import React from 'react';



function Footer(){
    const style = {
        textAlign:"center",
        backgroundColor:"black",
        lineHeight: "100px",
        color:"white"
    }
  return(
    <div className="footer" style={style}>
       <p>&copy; 2020 All Right Reserved</p>
     </div>
  )
}

export default Footer
